package elegant.access.apidemo

import com.google.gson.Gson
import elegant.access.apidemo.legacy.jsoner.AdmobConfigResponse
import elegant.access.apidemo.legacy.jsoner.Jsoner
import junit.framework.TestCase
import org.junit.Test


/**
 * Example local unit test, which will execute on the development machine (host).
 *
 * See [testing documentation](http://d.android.com/tools/testing).
 */
class ExampleUnitTest {

    @Test
    fun threadSafetyTest(){
        for (i in 1..5) {
            Thread{
                val instance = Jsoner.getInstance()
                println("======")
                println("instance:$instance======")
                println("======")
            }.start()
        }
    }


    @Test
    fun jsonNullTest(){

        val admobConfigResponse = Jsoner.getInstance().fromJson(
            makeHardcodeResponse(),
            AdmobConfigResponse::class.java
        )
        println("====================")
        println(Gson().toJson(admobConfigResponse))
        println("====================")

        TestCase.assertNotNull("Verify that object is null", admobConfigResponse.code)


    }


